import React from 'react';
import styled from 'styled-components';

function ExpenseItem(props) {
	return (
		<div>
			<Wrapper>
				<Date>
					<h2>{props.date.getMonth}</h2>
					<h3>{props.date.getYear}</h3>
					<h1>{props.date.getDay}</h1>
				</Date>
				<Item>{props.item}</Item>
				<Cost>{props.cost}</Cost>
			</Wrapper>
		</div>
	);
}

export default ExpenseItem;

const Wrapper = styled.div`
	display: flex;
	justify-content: center;
	align-items: center;
	background-color: #f4abc4;
`;

const Date = styled.div`
	flex: 1;
	display: flex;
	flex-direction: column;
	justify-content: center;
	align-items: center;
	border: 5px solid white;
	color: white;
	background-color: #0f0f0f;
	padding: 0.2px 10px;
	border-radius: 10px;

	h1 {
		font-size: 16px;
		font-weight: 400;
	}
	h2 {
		font-size: 12px;
		font-weight: 400;
	}
	h3 {
		font-size: 8px;
		font-weight: 200;
	}
`;

const Item = styled.div`
	flex: 2;
	display: flex;
	justify-content: flex-start;
	align-items: center;
`;

const Cost = styled.div`
	flex: 1;
	display: flex;
	justify-content: center;
	align-items: center;
	border: 5px solid white;
	color: white;
	background-color: #7e7474;
	padding: 5px 10px;
	border-radius: 10px;
`;
